import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';

export default function BasicTextFields() {
  return (
    <Box
      component="form"
  
      noValidate
      autoComplete="off"
    >
      <TextField id="outlined-basic" label="Nº Registro" variant="outlined" />
      <TextField id="outlined-basic" label="Usuário do Cadastro" variant="outlined" />
    </Box>
  );
}
